INSERT INTO `maintopic` VALUES (1,'AnNinhChinhTri','﻿Khẳng định bảo vệ chủ quyền là nhiệm vụ thiêng liêng, Thủ tướng Nguyễn Tấn Dũng yêu cầu Trung Quốc không tái diễn hành vi đặt trái phép giàn khoan trên thềm lục địa của Việt Nam\nThủ tướng đánh giá cao và biểu dương các cơ quan chức năng, lực lượng thực thi pháp luật trên biển, bà con ngư dân, đồng bào trong và ngoài nước đã biểu thị thái độ và trách nhiệm cao, đấu tranh bảo vệ chủ quyền thiêng liêng của Tổ quốc\nKhám xét nhà của Alomar, cảnh sát tìm thấy 165 gram heroin giấu dưới thảm tủ bát đĩa và 55 gram ma túy ở  lỗ thông gió trên trần nhà tắm. Alvarado và Alomar có thể phải đối diện với mức án từ 10 năm đến chung thân.\nMỹ đang dự tính gia tăng hoạt động trinh sát và sự hiện diện hải quân gần các vùng biển tranh chấp để đối phó với hành vi bành trướng chủ quyền chậm mà chắc của Trung Quốc. Tuy nhiên, hiệu quả của chiến thuật này vẫn còn là một dấu hỏi. \nAn ninh khu vực bị đe dọa nếu Trung Quốc xây căn cứ ở Trường Sa\nNgoài 5 cán bộ cấp tỉnh bị kỷ luật, Thanh tra Chính phủ cũng phát hiện nhiều vụ việc liên quan tham nhũng, gây thất thoát số tiền hơn 2,3 tỷ đồng. \nTAND tối cao tại Hà Nội mở phiên xử xem xét kháng cáo của Nguyễn Duy Linh (25 tuổi, ở huyện Thanh Oai) xin giảm nhẹ tội Giết người\nKhông chịu nổi đói, hung thủ giết vợ ra đầu thú\nTôi phải làm gì để tố cáo hành vi phạm pháp này. Tôi biết hắn là kẻ thủ đoạn, quan hệ rộng nên rất sợ\nCuộc truy tìm nhóm xả đạn gây 5 vụ cướp chấn động Sài Gòn\nSau trận Đồng Nai thua 3-5 trước đội chủ nhà Than Quang Ninh chiều qua (20/7) tại vòng 21 V-League 2014, cơ quan an ninh đã gặp và thẩm vấn 6 cầu thủ đội khách tại khách sạn, về những biểu hiện và thông tin liên quan đến nghi án tiêu cực trong trận đấu.\nĐối tượng dàn xếp vụ giết người lẩn trốn suốt 5 năm ròng mới sa lưới công an.\nTrong vụ án này, Ngô Quang Trưởng và Vũ Văn Luân bị kết án tử hình, 7 đối tượng khác cũng bị kết án tù. Tháng 1-2014, ông Trưởng đã qua đời tại trại giam Chí Hòa do bệnh trước khi thi hành bản án tử hình.\nNhững gã đàn của \"nữ quái\" Dung Hà là những tên sừng sỏ vốn nổi danh với những phi vụ đâm thuê chem mướn hay thanh trừng kiểu xã hội đen.\nSau khi bị 4 anh em họ thay nhau hãm hại, thiếu nữ 16 tuổi rơi vào trạng thái tâm thần bấn loạn.\nĐể có nhiều khách đến mua dâm, các gái bán dâm đã nhờ Túc chụp ảnh khỏa thân rồi tung lên mạng câu khách.\nGái mại dâm không cần đứng đường, bị chủ chứa, bảo kê ăn chặn nữa. Chỉ cần trả một khoản phí nhỏ cho chủ web sex, các cô gái sẽ được lăng xê rộng rãi, và có thể ngồi nhà tự giao dịch với khách.\nTuấn dùng dao khống chế, trói tay, dán miệng đồng bọn là nhân viên nhà băng bằng băng dính. Một tên khác lao tới khống chế nữ thủ quỹ ép mở két sắt cướp gần một tỷ đồng.\nSau hơn một năm thực hiện vụ cướp túi xách của nghệ sĩ Hồng Vân làm nạn nhân gãy cổ xương đùi, Trung và đồng bọn phải hầu toà\nRạng sáng 19/7, cảnh sát phát hiện hàng chục người mang theo vũ khí vận chuyển 108 bánh heroin tại địa phận bản Thung Cuông, Vân Hồ, Vân Hồ, Sơn La\nSau 5 km vượt đường rừng lầy lội do ảnh hưởng của bão, Công an tỉnh Sơn La áp sát nhóm người vận chuyển ma tuý, kêu gọi đầu hàng nhưng bị chúng bắn trả quyết liệt\nThủ tướng Malaysia Najib Razak cùng phu nhân đang thăm chính thức Việt Nam, sau khi ông trực tiếp chứng kiến hoạt động tìm kiếm chuyến bay MH370 mất tích ở Australia\nCảnh sát và lực lượng bảo an được tăng cường dày đặc tại quảng trường Thiên An Môn và nhiều địa điểm tập trung đông người khác ở Trung Quốc sau vụ tấn công nhà ga ở tỉnh Vân Nam làm 29 người thiệt mạng.\nNạn nhân được người dân đưa đi cấp cứu nhưng đã tử vong vào ngày hôm sau.\nCục Cảnh sát Phòng chống tội phạm sử dụng công nghệ cao (C50) - Bộ Công an cùng các cơ quan chức năng vừa triệt phá nhiều nhóm đối tượng phát tán tin nhắn rác lừa đảo chiếm đoạt phí dịch vụ của các thuê bao di động.\nMáy bay mang số hiệu MH17 của hãng hàng không Malaysia Airlines bị bắn rơi ngày 17/7 tại miền đông Ukraine, khiến 298 người thiệt mạng. Cho tới nay, nhiều câu hỏi quan trọng về thảm họa này vẫn chưa có lời giải đáp thỏa đáng.\nĐể cùng \"phiêu\" với ma túy đá, cặp tình nhân đã chọn nhà nghỉ làm bến đỗ.\nSau khi lấy hết tài sản, 4 tên đồi bại đưa cô gái vào rừng keo rồi thay nhau giở trò đồi bại.\nSau khi thoả mãn, kẻ tự nhận là công an đã trói tay nạn nhân để cướp iPhone, xe máy...\nTại nơi ở của Collins, cảnh sát thu được nhiều vết máu đã khô. Có thể hắn đã giết một vài nạn nhân tại nhà sau đó phi tang xác ở những nơi khác.\nHành vi giao cấu với tử thi không chỉ biến y thành \"con quỷ\" dâm ô mà còn làm khổ vợ, khổ con.\nTổng thống Nga Vladimir Putin cho rằng không được chính trị hóa vụ máy bay MH17 gặp nạn và các nước cần làm mọi việc để đảm bảo an toàn tại hiện trường cho các nhà điều tra quốc tế. \nGần chục người được cho là liên quan đến nghi án bán độ trong trận Đồng Nai - Than Quảng Ninh đã bị bắt ngay sau trận cầu kết thúc chiều 20/7.\nCục Cảnh sát điều tra tội phạm về trật tự xã hội - Bộ Công an phía Nam (C45B) cho biết, đến sáng 21/7, có 4 cầu thủ ở đội Đồng Nai, một người ở đội Đồng Tâm - Long An và ít nhất 4 cá nhân khác đã bị bắt giữ vì nghi liên quan đến nghi án bán độ.\nHầu hết người dân Nga tỏ ra bức xúc trước việc phương Tây và Ukraine đổ lỗi cho Tổng thống Vladimir Putin về thảm kịch máy bay MH17, đồng thời đặt ra nhiều giả thuyết âm mưu liên quan đến Mỹ đằng sau vụ việc này.\nThanh tra chính phủ kết luận ông Lê Thanh Cung, Chủ tịch tỉnh Bình Dương không phạm luật như ông Đại gia Huỳnh Uy Dũng tố cáo. Ngược lại, theo Thanh tra Chính phủ, Thủ tướng đã chỉ đạo cơ quan chức năng làm rõ việc phân lô bán nền tại KCN Sóng Thần 3 do công ty ông Dũng làm chủ đầu tư.\nChiều 22/7, Hội đồng thi hành án tử hình thành phố Hà Nội đã thi hành án tử hình với Nguyễn Đức Nghĩa (30 tuổi, ở phường Phú Lãm, quận Kiến An, Hải Phòng) can tội Giết người, Cướp tài sản\nPhát hiện nam thanh niên nghi vấn, các trinh sát âm thầm theo dõi và ra tay bắt gọn khi người này vừa giật tài sản của nạn nhân\nTrong vài ngày qua Trung Quốc đã công bố một loạt động thái phi pháp trên quần đảo Hoàng Sa thuộc chủ quyền của Việt Nam, như thành lập Ủy ban dân cư khu vực đảo Hữu Nhật, khai thông tuyến hàng hải tại đảo Duy Mộng\nThông tin từ Tỉnh ủy Bến Tre ngày 23/7 cho biết, Ủy ban Kiểm tra Trung ương Đảng (UBKTTW) đã công bố quyết định tiến hành kiểm tra đảng viên có dấu hiệu vi phạm đối với ông Trần Văn Truyền (nguyên Tổng Thanh tra Chính phủ). \nThử nghiệm thực tế trên chiếc smartphone Redmi Note của hãng điện thoại Trung Quốc Xiaomi được bán tại thị trường Việt Nam cho thấy chiếc smartphone này âm thầm kết nối và gửi thông tin người dùng về một máy chủ đặt tại Trung Quốc, như những báo cáo được đưa ra gần đây.\nVạch trần chiêu lừa của nhóm đối tượng Đài Loan nhắm vào người Trung Quốc\nMột thủ đoạn lừa đảo công nghệ cao hoàn toàn mới do nhóm người Đài Loan – Trung Quốc thực hiện trên lãnh thổ Việt Nam vừa bị công an TPHCM phát hiện\nSáng 23.7, Đội CSĐT tội phạm về TTXH Công an Q.Tân Bình (TP.HCM) chính thức tiếp nhận clip ghi cảnh đánh đập trẻ tự kỷ ở “Trường tiểu học chuyên biệt Anh Vương”, do PV Thanh Niên cung cấp, để phục vụ công tác điều tra.\nMua dâm là hành vi vi phạm pháp luật, vi phạm đạo đức xã hội, trái với thuần phong mỹ tục. Do vậy, công khai danh tính người mua dâm là hoàn toàn phù hợp với luật pháp\nHôm đó, kiểm tra hành chính một nhà nghỉ ở phường Phúc Diễn, quận Bắc Từ Liêm, cảnh sát bắt quả tang 4 đôi nam nữ có hành vi mua bán dâm. 4 cô gái bán dâm đều trong độ tuổi 9X, đa số là sinh viên.\nÔng Thanh được cho là chém vợ chết tại chỗ sau khi giết mẹ già giấu xác vào xó bếp.\nTheo điều tra ban đầu, sáng cùng ngày, sau khi vợ là Lê Thị Toàn (50 tuổi) đi chợ, Thanh ở nhà với mẹ Vũ Thị Nguyệt (88 tuổi). Khoảng 9h, người đàn ông này bất ngờ cầm dao hạ sát mẹ già, kéo xác vào xó bếp rồi dùng hai bao trấu chặn lên.\nKhi múa dân gian không còn được các phòng trà chuộng, Vân Anh xin làm PG trong nhóm của Đạo rồi gia nhập đường dây bán dâm do anh ta tổ chức.\nChiều 27/7, Công an tỉnh Tiền Giang đã phối hợp các cơ quan chức năng khám hiện trường, khám nhiệm tử thi nam giới trôi trên sông với 2 chân bị cột chặt.\nLiên quan đến vụ án mạng giết mẹ đẻ và vợ rồi phi tang xác ngay tại nhà ở xã Triệu Thành, huyện Triệu Sơn (Thanh Hóa), Công an tỉnh Thanh Hóa cho biết, nghi can có tiền sử bệnh tâm thần, không làm chủ được hành vi nên rất khó khởi tố vụ án.\nNhóm “hiệp sĩ” Bình Dương chia sẻ kinh nghiệm cho nhóm “hiệp sĩ” TP.HCM bằng cách hai nhóm cùng nhau ra đường bắt trộm cướp. Kết quả, một “nữ tặc” sa lưới vì không thoát được ánh mắt tinh tường của chàng “hiệp sĩ” nổi tiếng của vùng đất Gốm.\nTrung Quốc đang tiến hành tập trận bắn đạn thật trên vịnh Bắc Bộ, gần sát Việt Nam và sẽ bắt đầu tập trận tại biển Hoa Đông vào ngày 29/7 tới.\nNếu như trước đây đàn voi lớn tung hoành dọc ngang giữa đại ngàn, giúp đồng bào Tây Nguyên giữ rừng, giữ đất, bảo vệ buôn làng thì nay do nạn phá rừng và săn bắn trái phép, voi ở Tây Nguyên đang có nguy cơ bị tuyệt chủng.\nÍt phút sau khi phát hiện bà Cúc đầm đìa máu, người dân tìm thấy ông Mạnh bất tỉnh với lọ thuốc trừ sâu trên tay.\nKhi múa dân gian không còn được các phòng trà chuộng, Vân Anh xin làm PG trong nhóm của Đạo rồi gia nhập đường dây bán dâm do anh ta tổ chức.\nMột người trực tiếp nhập hàng cùng 2 nhân viên hải quan đã bị đề nghị truy tố do để lô hàng hiệu xuất xứ châu Âu núp bóng hàng Trung Quốc trốn thuế hàng chục tỷ đồng.\nChặn cô gái trên đường, nhóm thanh niên quát nạt, đòi \"bắt về đồn\". Khi chúng bỏ đi cùng với xe máy của nạn nhân, các nhân chứng mới biết đây là nhóm cướp giả danh.\nÔm 80 triệu đồng chạy vào một ngôi nhà cố thủ, Thanh bắn bị thương lãnh đạo phòng Cảnh sát hình sự Công an tỉnh Hà Tĩnh trước khi bị bắt.\nHai ngày uống nước dừa để sống, chịu không nổi đói và sự tấn công của côn trùng, kẻ đánh chết vợ ra đầu thú, khai hành vi dã man.\nHai kẻ cầm đầu các nhóm giang hồ mới nổi tại TP HCM đã mang súng, mã tấu xông vào nhà hàng chém người trả thù cho đàn em.\nQua điều tra, từ hình ảnh camera và lời khai nhân chứng, cảnh sát xác định 2 nghi can trực tiếp gây án là Đức và Lâm nhưng họ đã bỏ trốn.\nBiết người đàn bà có nhan sắc muốn quen đại gia, gã bán vé số dạo nhiệt tình mai mối để lập mưu giết người, cướp tài sản.\nHai tháng sau vụ chìm tàu trên vùng biển Cần Giờ làm 9 người đi đám cưới thiệt mạng, Công an TP HCM đã bắt giam Giám đốc Công ty Việt - Séc và người đứng đầu của Vũng Tàu Marina.\n35 năm đã qua, nhưng những ngọn núi, thân cây dọc biên cương một dải phía Bắc vẫn còn đó những dấu ấn về cuộc chiến bảo vệ đất nước trước quân xâm lược Trung Quốc. Từ Móng Cái đến Lai Châu, từ huyện đến thôn bản nào cũng gặp các nhà bia ghi tên những người lính đã ngã xuống trong những tháng năm khốc liệt ấy.\nChiều 27.7, Công an quận Liên Chiểu (Đà Nẵng) xác định nguyên nhân vụ ông Cao Văn Mạnh (53 tuổi, trú tổ 5 phường Hòa Hải, quận Ngũ Hành Sơn, TP.Đà Nẵng) đâm chết bà Mai Thị Cúc (52 tuổi, trú K166/34 Nguyễn Lương Bằng, phường Hòa Khánh Bắc, quận Liên Chiểu) rồi tự tử là do mâu thuẫn tình ái.\nLực lượng thi hành nhiệm vụ phải nổ súng và trong quá trình khống chế đối tượng, thiếu tá Nguyễn Vinh Cảnh, Phó phòng Cảnh sát hình sự Công an tỉnh Hà Tĩnh đã bị thương do một viên đạn xuyên vào đùi. Đến hơn 10 giờ cùng ngày hung thủ bị lực lượng chức năng bắt giữ cùng với 1 khẩu súng, 2 viên đạn, 80 triệu đồng vừa lấy của gia đình anh Thiện. Tại cơ quan điều tra, hắn khai nhận là Phan Xuân Thanh (32 tuổi, ngụ P.Cửa Nam, TP.Vinh, Nghệ An).\nUBND TP.Hà Nội yêu cầu trong vòng 6 tháng kể từ ngày khởi công, Vinaconex phải hoàn thành toàn tuyến đường ống nước sạch sông Đà bằng thép. \nSáng 27.7, thừa ủy quyền của Chủ tịch nước, Thường trực Thành ủy, HĐND, UBND và Ủy ban MTTQ VN TP.HCM tổ chức lễ truy tặng danh hiệu Bà mẹ VN anh hùng cho 831 mẹ tại 4 cụm quận, huyện và 3 đơn vị trên địa bàn TP có đông các mẹ được truy tặng. \nSáng 27.7, Chủ tịch nước Trương Tấn Sang đến kiểm tra tiến độ đóng tàu kiểm ngư KN 782 tại Công ty TNHH đóng tàu Hạ Long, TP.Hạ Long, Quảng Ninh. \nNgày 27.7, Công an tỉnh Hà Tĩnh cho biết đã bắt giữ kẻ tống tiền người dân và bắn bị thương một cán bộ công an. \nTheo Cục An toàn thực phẩm (Bộ Y tế), thời gian gần đây, các cơ sở điều trị tại Đà Nẵng, TP.HCM tiếp nhận điều trị nhiều ca bệnh nặng, diễn biến nguy kịch và đã có một số trường hợp tử vong do sử dụng ốc sên làm thức ăn, chữa bệnh; việc sử dụng ốc sên ở dạng sống, tái, nướng làm xuất hiện bệnh lý cấp tính ảnh hưởng đến sức khỏe và tính mạng của người ăn.\nTheo cơ quan điều tra, trong số các bị can môi giới cho khách mua dâm có nhiều gái mại dâm chưa đủ 16 - 18 tuổi, nên cơ quan điều tra đã khởi tố vụ án mua dâm người chưa thành niên. Tuy nhiên do chưa xác định được người mua dâm nên cơ quan điều tra đã tạm đình chỉ vụ án, khi nào bắt được sẽ xử lý sau.\nNgày 27.7, Mỹ đã công bố hình ảnh chụp từ vệ tinh cho thấy pháo của Nga bắn sang lãnh thổ Ukraine, nhằm thẳng vào quân đội nước này.\nMột dự án liên danh đóng tàu ngầm cỡ nhỏ thế hệ mới giữa Ý và Nga đã bị đình chỉ vô thời hạn do \'tình hình chính trị\'.\nĐài RT (Nga) đưa tin NATO có chủ trương tập trung hậu cần tại một căn cứ ở Ba Lan đủ dùng cho một cuộc tấn công chớp nhoáng vào nước Nga.\nNhiệm vụ của tư vấn giám sát là phải theo dõi, kiểm tra tiến độ và chất lượng thi công, thế nhưng khi nghiệm thu thì các ông lại giở bài “đánh võng” rồi “lượn” chán chê để gây khó dễ, vòi vĩnh chia tiền rồi mới ký cho nhà thầu\nThủ tướng vừa có các quyết định bổ nhiệm, bổ nhiệm lại cán bộ lãnh đạo của Thanh tra Chính phủ và một số cơ quan.\nSự chậm trễ của các điều tra viên quốc tế và việc hiện trường bị xáo trộn nghiêm trọng khiến cuộc điều tra có thể không bao giờ tìm được thủ phạm.\nPhe ly khai ở miền đông Ukraine đã cho phép một lực lượng an ninh quốc tế bao gồm 300 cảnh sát tới hiện trường máy bay MH17 rơi, để bảo vệ các nhân viên điều tra quốc tế làm việc tại đây.\nTại địa điểm có giàn khoan trái phép, Trung Quốc triển khai 80 tàu xung quanh đó và số lượng tàu ngày một tăng lên. Tàu Trung Quốc ngang ngược đâm tàu Việt Nam, 6 kiểm ngư viên Việt Nam bị thương.\nSau 75 ngày hoạt động trái phép, cuối cùng Hải Dương 981 cũng phải rút ra khỏi vùng biển Việt Nam.\nBill Hayton, tác giả cuốn sách “Biển Đông và cuộc chiến giành quyền lực ở châu Á” vừa có bài viết phản bác tất cả những luận điệu của Trung Quốc về cái gọi là “bằng chứng lịch sử” đối với Biển Đông.\nNgày 22/5, quân đội Thái Lan tuyên bố đảo chính và tiếp quản quyền lực của chính phủ, đánh dấu cuộc đảo chính thứ 12 kể từ năm 1932 tới nay.\nChính quyền quân sự Thái Lan bắt đầu chiến dịch vây ráp quy mô lớn, buộc 130.000 lao động Campuchia tháo chạy về nước.\nLãnh đạo chính quyền quân sự Thái Lan, Tướng Prayuth Chan-ocha, hôm nay (13/6) cho biết, một chính phủ lâm thời sẽ được thành lập vào tháng 8 tới.\nLãnh đạo của cuộc đảo chính quân sự tại Thái Lan cho biết bầu cử sẽ không được tổ chức trong hơn 1 năm tới, để có đủ thời gian cho hòa giải và cải cách chính trị.\nQuân đội Thái Lan tìm cách dập tắt làn sóng biểu tình chống đảo chính đang nhen nhóm.\nNgày 24/5, Cục Lãnh sự - Bộ Ngoại giao Việt Nam khuyến cáo công dân Việt Nam lưu ý, chưa đi Thái Lan nếu không thật cần thiết, cho tới khi tình hình nước này ổn định.\nCựu Thủ tướng Thái Lan Yingluck Shinawatra và một số thành viên của gia đình bà đã bị quân đội nước này bắt giữ.\nRIA Novosti cho rằng quân đội Ukraine đã vô tình bắn hạ MH17 vì nhầm nó với một chiến đấu...\nPhe ly khai ở miền đông Ukraine đã cho phép một lực lượng an ninh quốc tế bao gồm 300 cảnh sát tới hiện trường máy bay MH17 rơi, để bảo vệ các nhân viên điều tra quốc tế làm việc tại đây.\nThủ tướng Australia Tony Abbott đã điều động 190 cảnh sát và một số quân nhân tham gia lực an ninh quốc tế, trong khi Malaysia thông báo 68 cảnh sát của nước này đã rời Kuala Lumpur để tới hiện trường máy bay rơi ở miền đông Ukraine vào ngày 23/7. Hà Lan điều 40 cảnh sát quân sự tới hiện trường để giúp đỡ hoàn thành công việc pháp y và thu thập bằng chứng.\nPháp y Hà Lan đã nhận dạng được nạn nhân đầu tiên trên chuyến bay xấu số MH17.\nLà quốc gia có nhiều công dân thiệt mạng nhất trong chuyến bay này, vì vậy chính phủ Hà Lan chịu trách nhiệm xác định danh tính của các nạn nhân trên chuyến bay xấu số này.\nHuỳnh Minh Siêng 71 tuổi, ngụ tạo ấp 5 xã Mỹ Thạnh, huyện Giồng Trôm, tỉnh Bến Tre. Tòa phúc thẩm đã tuyên y án 20 năm tù cho 2 tội hiếp và giao cấu với trẻ em.\nNgày 23-7, HĐXX Tòa phúc thẩm TAND tối cao tại TP.HCM đã bác kháng cáo xin giảm nhẹ hình phạt đối với bị cáo Hoàng Văn Hùng (52 tuổi, quê Hải Phòng) và tuyên y án sơ thẩm 20 năm tù.\nSáng 21-7, TAND tối cao tại TP.HCM đã xét xử phúc thẩm 2 bị cáo Nguyễn Thành Phước (SN 1996) và Trần Bình Yên (SN 1985), cùng ngụ ấp Gò Cát, xã Vĩnh Trị, huyện Vĩnh Hưng, Long An về tội hiếp dâm trẻ em.\nTrong lúc nấp ở dốc cầu để chờ đánh trả thù một nhóm thanh niên, Võ Văn Giỏi và Võ Minh Nhựt chợt thấy thiếu nữ 14 tuổi đi ra nên cùng hè nhau lôi em vào bụi tre xâm hại.\nTheo hồ sơ vụ án, tối 4-9-2012, nghe người em bà con của mình nói bị một nhóm thanh niên đang uống rượu tại nhà Bùi Hữu Nhơn ngụ cùng xã đánh nên Giỏi và Nhựt chạy xe tìm gặp nhóm thanh niên kia đánh trả thù. \nGần 200 người thuộc lực lượng trinh sát đã đồng loạt tấn công vào khoảng 20 cơ sở thầu đề qui mô lớn tại TP. Cần Thơ vào chiều, tối hôm qua 24-7.\nNgày 23-7, bà Nguyễn Thị Mai, chánh án TAND TP Hải Phòng, cho biết đã nhận được yêu cầu của TAND tối cao về việc báo cáo lại nội dung, toàn bộ quá trình xét xử vụ án cướp giật mũ tại Tiên Lãng.\nTrong vụ án này hành vi của các bị cáo đã đủ cấu thành tội phạm cướp giật? Dư luận cho rằng đây chỉ là trò đùa con trẻ mà tòa xử với mức án như vậy là quá nặng?\nCơ quan điều tra khép các bị cáo mục đích giật về để sử dụng, tuy nhiên tất cả bị cáo đều là nam giới mà lấy mũ nữ về để sử dụng thì hơi khiên cưỡng\n Tất cả bị cáo đều trong tuổi vị thành niên, đều đang là học sinh. Dư luận cho rằng xử với một mức án như thế với một vụ việc cụ thể giật mũ này quá nặng cho bị cáo, gần như khép lại tương lai của bị cáo\ntheo nguồn tin từ Cơ quan cảnh sát điều tra Công an tỉnh Bình Phước, quá trình điều tra vụ án “tham ô tài sản” xảy ra tại Ủy ban Mặt trận Tổ quốc VN tỉnh Bình Phước cho thấy bị can Huỳnh Nguyễn Quế Trâm (33 tuổi, kế toán, bị bắt giam tháng 5-2013) chiếm đoạt trên 7,2 tỉ đồng.\nTrong quá trình truy bắt tên cướp, có một phó phòng PC45 bị thương ở đùi và chân. Một lãnh đạo Công an tỉnh Hà Tĩnh cho biết người bị thương không phải trúng đạn của tên cướp mà trúng đạn trong lúc va vấp khi truy đuổi\nGiới chuyên gia quốc tế khẳng định Liên minh châu Âu (EU) sẽ phải chấp nhận tổn thất kinh tế nghiêm trọng nếu cấm vận các ngành tài chính và năng lượng của Nga.\nTrong thời chiến tranh lạnh, các máy bay do thám SR-71 và U-2 là những vũ khí thăm dò từ trên không chính của siêu cường Mỹ. Còn thế kỷ 21 thì sao\nCả ba cuộc hội thảo do ba trường đại học tổ chức tại TP.HCM trong ngày 26-7 về tình hình biển Đông đều có chung nhận định rõ ràng: Trung Quốc đã không tôn trọng luật pháp quốc tế, Việt Nam phải tiếp tục đấu tranh pháp lý để khẳng định chủ quyền của mình.\nĐây là đề nghị của bà Jeanne Mirer, chủ tịch Hiệp hội Luật sư dân chủ quốc tế (IADL) - với báo chí bên lề hội thảo thảo quốc tế “Những khía cạnh pháp lý liên quan đến sự kiện Trung Quốc hạ đặt giàn khoan Hải Dương 981 trong vùng biển Việt Nam” ngày 26-7 tại TP.HCM.\nMột học giả đã phân tích như vậy về chuyện gây hấn của Trung Quốc không chỉ trên biển Đông mà cả trên đất liền.\nĐộc giả đã theo dõi rất sát tình hình thời sự, tìm hiểu rất nhiều về các bằng chứng chủ quyền Hoàng Sa - Trường Sa của Việt Nam. Họ muốn hiểu biết nhiều hơn nữa và cũng muốn nhiều người biết hơn nữa\nTối 24-6, tại công viên quảng trường 2-4 (TP Nha Trang, Khánh Hòa) đã khai mạc triển lãm ảnh với chủ đề “Chung sức bảo vệ chủ quyền biển đảo Việt Nam\nNgày 16-5, PV Viễn Sự và Tấn Vũ đang trên tàu cảnh sát biển 4032 đã truyền về những hình ảnh nóng bỏng nhất trong những ngày qua tại khu vực Trung Quốc hạ đặt trái phép giàn khoan Hải Dương 981\nĐây là năm bộ phim với những nội dung phong phú đầy cảm xúc, nói lên cảnh đẹp của quê hương đất nước và con người VN, ca ngợi sự hi sinh của người lính biển ngày đêm giữ đảo, giữ biển của quê hương đất nước.\nThông qua tổng đài nhà mạng di động, Công an TP.HCM đang truyền đi thông điệp cảnh báo người dân về trò lừa đảo gọi điện thoại.\nNgày 2-7, mạng di động MobiFone phát đi thông báo cảnh báo về các hình thức lừa đảo mới trên điện thoại di động. \nNhững cay nghiệt của cuộc đời liên tiếp ập xuống đầu Hiệp để rồi trong phút quẫn trí, anh ta đã điên cuồng chém, giết cha dượng, em trai, hàng xóm và người tình trong đêm\nTrần Xuân Phương biết đến là một trong những tên tội phạm hung hãn nhất từ trước đến nay. Hung thủ liên tục giết nhiều người nhưng không bị phát hiện suốt một thời gian dài.\nCơ quan điều tra Bộ Công an đã ra lệnh bắt khẩn cấp 6 cầu thủ của CLB bóng đá Đồng Nai để điều tra phi vụ bán độ, dàn xếp tỷ số xảy ra tại giải bóng đá vô địch quốc gia.\nCác nhà điều tra quốc tế đang khai thác thông tin từ hộp đen, bao gồm cả ghi âm buồng lái, cũng như các nội dung máy ghi dữ liệu chuyến bay.\nNgoại trưởng Nga cho rằng Mỹ đang tìm cách cản trở hoạt động của OSCE tại Ukraina trong bối cảnh các cuộc giao chiến bùng phát xung quanh khu vực MH17 gặp nạn.\nReuters nhận định sự phản đối gay gắt từ người dân có thể là một trong những lý do khiến Trung Quốc di chuyển giàn khoan Hải Dương 981 khỏi vùng biển Việt Nam.\nChúng ta đang giống như cướp biển. Tôi xấu hổ vì là người Trung Quốc. Trong khi bạo động trong nước đang khiến dân chúng lo lắng, chính quyền lại gây hấn với quốc gia khác\nNam thanh niên bị \"ngáo đá\" cầm dao xông vào trụ sở công an thành phố gây chuyện, cướp 2 khẩu súng quân dụng mang ra phố gây rối khiến công an phải nổ súng vây bắt.\nNgười dùng internet cần đặc biệt cẩn trọng trước các mẫu tin tuyển dụng này.\nPhát biểu tại Lễ bế mạc, Thủ tướng Nguyễn Tấn Dũng chào mừng các đại biểu, nhà khoa học, các thầy cô giáo và các học sinh đến từ 77 nước và vùng lãnh thổ trên thế giới. \"Các em học sinh chính là những chủ nhân của cuộc thi này - một cuộc thi mà tất cả chúng ta là người chiến thắng\" - Thủ tướng Nguyễn Tấn Dũng nói.\nChính phủ Việt Nam luôn quan tâTrung Quốc sẽ phóng một vệ tinh quan sát Trái Đất lên quỹ đạo trong năm nay, nhằm hỗ trợ hoạt động khảo sát địa chất, giám sát biến đổi khí hậu và thiên tai.m phát triển và trọng dụng những tài năng khoa học công nghệ, trong đó có những tài năng về hóa học\", Thủ tướng khẳng định\nĐề thi tiếng Anh không quá cao xa nhưng hay đánh lừa. Nếu nắm chưa vững kiến thức, thí sinh rất có thể bị sa lưới.\nBộ Ngoại giao Mỹ mới đây cho biết Trung Quốc đã thử nghiệm một loại tên lửa chống vệ tinh, đồng thời yêu cầu Bắc Kinh kiềm chế những hành động gây mất ổn định.\nMại dâm nên cấm hay cho phép? Hiện nay có 2 luồng ý kiến trái chiều, cá nhân tôi, Nhà nước tuyệt đối cấm mại dâm, bởi các lý do sau\nLấy gì đảm bảo rằng chiến tranh xâm lược của ngoại bang sẽ không lặp lại trên dải đất hình chữ S?\nNhà sản xuất chi phối thị trường văn bằng “rởm” chính là ngành Giáo dục, còn nơi tiêu thụ, sử dụng bằng “rởm” nhiều nhất chính là các cơ quan nhà nước.\n\n','Khẳng định bảo vệ chủ quyền nhiệm vụ thiêng liêng Thủ tướng Nguyễn Dũng yêu cầu Trung Quốc tái diễn hành vi đặt trái phép giàn khoan thềm lục địa Việt Nam\nThủ tướng đánh cao biểu dương quan chức năng lực lượng thực thi pháp luật biển bà ngư dân đồng bào nước biểu thị thái độ trách nhiệm cao đấu tranh bảo vệ chủ quyền thiêng liêng Tổ quốc\nKhám xét nhà Alomar cảnh sát tìm thấy gram heroin giấu thảm tủ bát đĩa gram ma túy lỗ thông gió trần nhà tắm Alvarado Alomar thể đối diện mức án đến chung thân \nMỹ dự tính gia tăng hoạt động trinh sát hiện diện hải quân gần vùng biển tranh chấp đối phó hành vi bành trướng chủ quyền chậm Trung Quốc nhiên hiệu chiến thuật dấu hỏi \nAn ninh khu vực đe dọa Trung Quốc xây Trường Sa\n cán cấp tỉnh kỷ luật tra phủ phát hiện vụ việc liên quan tham nhũng gây thất thoát tiền tỷ đồng \nTAND tối cao Hà Nội mở phiên xử xem xét kháng cáo Nguyễn Linh